import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let posts = [
    {id:1, content: 'Post1', likes: 10},
    {id:1, content: 'Post2', likes: 20},
    {id:1, content: 'Post3', likes: 30},
    {id:1, content: 'Post4', likes: 40}
];

let dialogs = [
    {id: 1, name: 'Name1'},
    {id: 2, name: 'Name2'},
    {id: 3, name: 'Name3'},
    {id: 4, name: 'Name4'}
];

let messages = [
    {id: 1, message: 'Heyo'},
    {id: 2, message: 'Hi'},
    {id: 3, message: 'Hello'},
    {id: 4, message: 'Salam'},
    {id: 5, message: 'Ola'}
];

let mainPhoto = 'https://www.w3schools.com/howto/img_avatar.png';

ReactDOM.render(<App posts={posts} mainPhoto={mainPhoto} dialogs={dialogs} messages={messages}/>, document.getElementById('root'));

serviceWorker.unregister();
